//Case class for histogram table
case class HistRow(startPoint:Double,count:Long)

//Function for create histogram table
def createHistogramTableAndRegister(df:DataFrame, columnName:String, viewName:String){
    val (startValues,counts) = df.select(columnName).map(value => value.getFloat(0)).rdd.histogram(5)
    val zippedValues = startValues.zip(counts)
    val rowRDD = zippedValues.map( value => HistRow(value._1,value._2))
    val histDf = sqlContext.createDataFrame(rowRDD)
    histDf.createOrReplaceTempView(viewName)
}
